window.bookSummaryJSON = "<p><b>THE BOYS OF HAREM STATION ARE KEEPING LOTS OF SECRETS!</b></p> <p>Valor joined up with Tray after Beauty's sacrifice because he knew Luck was destined to be with Princess Nyleena. There was no room in that relationship for a third wheel. But when he teamed up with Tray he had no idea that he'd be the third wheel in that partnership, too.</p> <p>Tray has been keeping ALCOR's secrets since the day he arrived on Harem Station. Not just one or two.... ALL of them. But he's also been keeping one of his own.</p> <p>His secret is a girl. Not a Cygnian girl. An <i>Akeelian</i> girl. A beautiful, mysterious, scheming secret girl that Tray has been in love with ever since she first turned up in his Pleasure Prison virtual reality asking him for help.</p> <p>Except she's not virtual.</p> <p>She's real.</p> <p>She's in danger.</p> <p>And before Valor came along all he wanted to do was break her out of her prison and keep her for himself.</p> <p>But now...he might have to learn to share.</p> <p><i>Prison Princess</i> is the fifth book in the Harem Station Series and features an erotic MMF m√©nage featuring double-endowed alien men, a girl who shouldn't exist in a virtual Paradise, a love-struck sentient ship, two all-powerful AI's willing to fight for her, and an entire book about LEARNING TO SHARE *wink-wink*. Book 5 in the Harem Station Series!</p> <p>Includes a special bonus note from the author.</p>"; 
